def longest_subsequence(data, length, up):
    P = [0 for x in range(length)]
    M = [0 for x in range(length + 1)]

    L = 0
    for i in range(length):
        lo = 1
        hi = L
        while lo <= hi:
            mid = math.ceil((lo+hi)/2)
            if up:
                if data[M[mid]] < data[i]:
                    lo = mid + 1
                else:
                    hi = mid - 1
            else:
                if data[M[mid]] > data[i]:
                    lo = mid + 1
                else:
                    hi = mid - 1
        newL = lo
        P[i] = M[newL - 1]
